import React from "react";
import List from "../../common/List/List";
import "./Sidebar.css";

function Sidebar() {
  const data = [
    {
      title: "Demand",
      to: "/demand",
      child: [
        {
          title: "New",
          to: "/new",
        },
        {
          title: "Select",
          to: "/select",
        },
      ],
    },
    {
      title: "Stored Procedures",
      to: "/sp",
      child: [
        {
          title: "New",
          to: "/new",
        },
        {
          title: "Select",
          to: "/select",
        },
      ],
    },
  ];

  return (
    <div className="sidebar__container">
      <div className="list__container">
        <ul className="list__items">
          {data.map((d) => (
            <List data={d} />
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Sidebar;
